import React from 'react';
import Link from 'next/link';
const Navbar = () => {
  const styles = {
    display: 'flex',
    background: 'grey',
    alignItems: 'space-between',
  };
  return (
    <div style={styles}>
      <Link href="/about">
        <a>About page</a>
      </Link>
      <Link href="/contact">
        <a>Contact page</a>
      </Link>
    </div>
  );
};

export default Navbar;
